import React from "react";
import "./App.css";
import { Accordion, Card , CustomToggle} from "react-bootstrap/Accordion";

export default class PageContent extends React.Component {
  render() {
    return (
      <Accordion defaultActiveKey="0" className="Content-wrapper">
        <Card>
          <Card.Header>
            <CustomToggle eventKey="0">{this.props.title}</CustomToggle>
          </Card.Header>
          <Accordion.Collapse eventKey="0">
            <Card.Body> {this.props.content}</Card.Body>
          </Accordion.Collapse>
        </Card>
      </Accordion>
      //   <div className="Content-wrapper">
      //     <h2 className="First">{this.props.title}</h2>
      //     {this.props.content}
      //   </div>
    );
  }
}
